import React,{useState,useEffect} from "react";
import { Link } from "react-router-dom";
import axios from "axios";

export default function Navbar(props) {
    const [purchases,setPurchases]=useState([]);
    const apiUrl= "https://65127e22b8c6ce52b395b28b.mockapi.io/api/v1/activity";

    const fetchPurchases=async()=>{
        try{
            const response=await axios.get(apiUrl);
            setPurchases(response.data);
        }
        catch(err){
            console.error("Error fetching the data:",err);
        }
    };

    useEffect(()=>{
        fetchPurchases();
    },[]);
  return (
    <>
      <nav className="navbar navbar-expand-lg navbar-light bg-dark">
        <h6 className="navbar-brand text-white">{props.name}</h6>
        <div className="collapse navbar-collapse" id="navbarText">
          <ul className="navbar-nav ml-auto"> {/* Changed 'mr-auto' to 'ml-auto' */}
            <li className="nav-item">
              <h6 className="nav-link text-white">{props.dob}</h6>
            </li>
            <li className="nav-item">
              <h6 className="nav-link text-white">{props.tier}</h6>
            </li>
            <li className="nav-item">
              <h6 className="nav-link text-white">
                TOTAL COUNT:{" "}
                <span className="badge bg-secondary ml-2">
                  This is the total count of all activities.
                </span>
              </h6>
            </li>
          </ul>
        </div>
      </nav>
      <div className="btn-group" role="group" aria-label="Basic example">
        <Link type="button" className="btn btn-primary" to="/">
          Activities
        </Link>
        <Link type="button" className="btn btn-primary" to="/rewards">
          Rewards
        </Link>
      </div>
      <div>
        <h2>Purchases:</h2>
        <ul>
            {purchases.map((purchase)=>(
                <li key={purchase.id}>{purchase.description}</li>
            ))}
            </ul>
      </div>
    </>
  );
}
